import React, { Component } from 'react';

class Concepts extends Component {
  render() {
    return (
      <div className="section">
        <h2 className="section-title">
          About me
        </h2>
        <p>
          I am graduate from Telecom ParisTech and HEC Paris. I started design on my own about five years ago. As I was studying Computer Science at the time and not design, I had to learn everything by myself. After spending a lot of time mimicking Apple products' user interfaces on Sketch, I started creating concepts on my own, using what I had learned during that first phase. My first concept was called iOS Fuji and can be found here. A few months later, I published iOS Fuji 2.0 which aimed at simplifying the initial concept. Ever since then, a dozen of projects have been created, some of which were aborted in the way, and others I am still thinking about today. As soon as I hold an object in my hands, I can't help but think about how its function could be improved.
        </p>
      </div>
    );
  }
}

export default Concepts;
